import puzzlePicture from "./PuzzleViewer/puzzleHolder"

const PuzzleViewer = () => {
    return (
        <div className="puzzleViewer">
            <div className="back">Back</div>
            <div>
                <img src={puzzlePicture} className="imageViewing"/>
            </div>
            <div>
                <h3>Part of Image being viewed</h3>
                <p>Description of what is being viewed</p>
            </div>
        </div>
    );
}

export default PuzzleViewer;
